`,Ww=["Kirk and Jessica","Perry & Elise","Arnold, Laura & Arie","Monica"],Vw=({selectedPeople:e,setSelectedPeople:t})=>{const[i,o]=j.useState(!1),s=l=>{t(l),o(!1)};return N.jsxs("div",{style:{backgroundColor:"white",position:"relative"},children:[N.jsx(Uw,{className:"dm-sans",onClick:()=>o(!i),children:i?N.jsx("span",{children:""}):N.jsx("span",{children:""})}),N.jsx(Hw,{isOpen:i,children:Ww.map(l=>N.jsx(wg,{className:"dm-sans",onClick:()=>s(l),children:N.jsx("b",{children:l})},l))})]})},xg=[{section:"special-values",special_values_name:"kirk-jessica"},{section:"intro",content:[{type:"photo",src:"/2025/kirk-jessica/intro.jpg"},{type:"text",person:"Kirk",text:"2025 was a big year full of change and adventure for Kirk and Jessica. The biggest change was their move to Delaware from Houston, where theyre excited to start a new chapter! At work at the Boston Globe, Kirk was fortunate enough to head the development and launch several large interactive news projects, and has been working on some apps as passion projects. He got back into running (slowly), and released his first solo album on Spotify, which was his goal to release before he turned 30! "},{type:"text",person:"Jessica",text:"2025 was a year that felt so far in the future but has flown by and was full of new adventures. Jessica started the year working in a clinic in Malawi and going on a safari in Kenya with Kirk! Jessica graduated from residency this year, completing her many years of medical training. She said goodbye to many friends in Houston but has also reunited with friends and family now that shes returned to the East Coast. After lots of studying and some time off, she is now officially double-board certified in both Internal Medicine and Pediatrics and started her dream job as a teaching attending and primary care physician for both adults and children at ChristianaCare in Wilmington, Delaware!"}]},{section:"travel",content:[{location:"Malawi/Kenya",latLong:[-13.986716798152944,33.76933175572749],img:"malawi",description:"Jessica went on an away rotation to a Baylor International Pediatric AIDS Initative (BIPAI) clinic in Malawi, and after she finished her month there, Kirk flew to meet her in Kenya where they went on a safari and visited Kirk's cousin Kara in Nairobi."},{location:"Corpus Christi/South Padre Island, TX",latLong:[26.109320348976528,-97.16693852876395],img:"corpus",description:"Kirk and Jessica celebrated their fifth anniversary with a weekend getaway to Corpus Christi and South Padre Island. The trip included a stay at a Best Western for Kirk's first Texas-shaped waffle! Kirk may have called upwards of six Best Westerns to find one that would gaurantee the experience."},{location:"Road trip from Houston to PA",latLong:[29.75895970087684,-95.36672240135393],img:"roadtrip",description:"In order to move back to the East Coast, Kirk and Jessica traveled through Mississippi, Alabama, Georgia, South Carolina and Maryland."},{location:"Disney vacation",latLong:[28.376980631549394,-81.57055963349711],img:"disney",description:"Kirk surprised Jessica with a trip to Disney World 10 years after she worked there as a college student. Kirk found every possible way to make the fireworks each night special  from the rooftop of The Contemporary, and on Main Street on the Fourth of July/Jessica's birthday, the new Epcot fireworks show while eating dinner at Monsiuer Paul's, and from their room at the Wilderness Lodge!"},{location:"Berkshires",latLong:[42.30705008626082,-73.24900250899663],img:"berkshires",description:"The Hsieh family (Kirk's mom's side) had a big reunion in the Berkshires where they got to catch up with cousins, aunts and uncles from far away, and enjoy the outdoors together as a big family."},{location:"Shenandoah National Park",latLong:[38.48571425410581,-78.45605205835578],img:"shenandoah",description:"To celebrate Jessica finishing both her boards, they took a trip to Senandoah to hike and see some friends back in Virginia. They couldn't pass up the opportunity to stop at the northernmost Buc-ee's on the way back."},{location:"Thailand",latLong:[13.760314714745624,100.5074442955878],img:"",description:"Kirk and Jessica might be in Thailand as you read thisthey're going to attend the wedding of one of Jessica's residency friends!"}]},{section:"best-bites",content:[{location_name:"Littles Oyster Bar",dish_name:"Lobster gnocchi",img:"lobster",description:"A beautiful and very filling dish at one of their favorite restaurants in Houston."},{location_name:"Kenya",dish_name:"African Passion Fanta",img:"fanta",description:"They just picked this up from the grocery store out of curiosity and now they can't go back to what they were used to!"},{location_name:"Kenya",dish_name:"Beef noodle soup",img:"kenyaBite",description:"They were surprised to discover stunningly authentic Chinese food in Nairobi, thanks to the large population of Chinese workers in the area. The beef noodle soup here was killer."},{location_name:"BORI",dish_name:"Scallion salad",img:"scallion",description:"Though it was just a side dish at this Houston KBBQ restaurant, the scallion salad stole the show."},{location_name:"Nonnos",dish_name:"Italian Wedding Soup risotto",img:"risottoclose",description:"It seemed like such a simple no-brainer combination. And once Kirk and Jessica sampled this, they started making it all the time at home."},{location_name:"Neo",dish_name:"Suzuki Aburi with Kurozu vinaigrette",img:"",description:"Jessica took Kirk out to his first omakase experience for his 30th birthday, and this was his favorite dish. It was seared over Japanese charcoal and dipped in a citrusy vinaigrette."},{location_name:"Home",dish_name:"Parmesan wheel",img:"parmstore",description:"It's been Kirk's dream for years to serve pasta in a big parmesan cheese wheel. He finally got to live his dream this year and served cacio e pepe at his 30th birthday party."},{location_name:"Z Counter",dish_name:"Beef short rib rice bowl",img:"zcounter",description:"This was a short stop in Corpus Christi on their anniversary trip, and their expectations were low. They were blown away by the quality of the meat, the sweet, salty and sour flavors, and the quantity!"},{location_name:"Little Pearl",dish_name:"THE Pork and Lychee Salad",img:"lychee",description:"Kirk and Jessica's friends Allison and Keegan got married at the Little Pearl in DC, and they served the best wedding food Kirk and Jessica have ever tasted. This was their favorite dish."},{location_name:"Taste of Texas",dish_name:"Ribeye",img:"steak",description:"Before leaving Texas, Kirk was informed he needed to try Taste of Texas. It was the best steakhouse he'd been to. Also the salad bar is crazy."},{location_name:"Houston Chinatown",dish_name:"our last food crawl (Tao Roll, shenjian bao, Grapefruit green tea)",img:"chinatown",description:"During their last week in Houston, they visited all of their greatest hits in Chinatown. It was bittersweet saying goodbye, but also delicious."},{location_name:"Enso",dish_name:"Strawberry matcha latte",img:"matcha",description:"This matcha popup in Houston had a long line but it was worth the way. While usually not a matcha fan, Kirk loved these lattes."},{location_name:"Monsieur Pauls",dish_name:"Saffron soup",img:"saffron",description:"Kirk surprised Jessica during their time at EPCOT with a dinner at Monsieur Paul's. This saffron soup was the star of the show."},{location_name:"Chu Shang",dish_name:"Malatang",img:"chushang",description:"Since this is Kirk's favorite restaurant in Philly, it only made sense to go straight there once they moved back to the East Coast."},{location_name:"DeLorenzos Tomato Pies",dish_name:"Tomato pie with basil",img:"pizza",description:"Kirk got to catch up with Chris, his best man, in NJ. Having pizza of this quality reminded Kirk that he was back home."},{location_name:"Bardea Food & Drink",dish_name:"Burrata pop tarts",img:"poptart",description:"Kirk and Jessica celebrated her new job at Bardea Food & Drink in Delaware. This was a family favorite!"},{location_name:"Local farm",dish_name:"CSA",img:"csa",description:"It's long been Jessica's dream to be a part of a community supported agriculture program, and the farm down the road has a great one!"}]},{section:"music",content:[{song_title:"Pink Pony Club",artist:"Chappell Roan",url:"https://open.spotify.com/track/1k2pQc5i348DCHwbn5KTdc?si=1a6981fcc5fa44cf",description:"This song got Jessica through her commutes to the hospital. It's upbeat and fun, meaning Jessica stays awake!"},{song_title:"Kirkland",artist:"Max Leone",url:"https://open.spotify.com/track/4OxjnvgN5wtUNALPUPIyAz?si=e758c625170f4822",description:"While searching for the right artist name to release Kirks music under, we came across this song. It was actually a bop."},{song_title:"MCU",artist:"Kirk An",url:"https://open.spotify.com/track/5n0bMzyufZwaNuZlzIAHwD?si=ba09158a38324c3b",description:"This is Jessicas favorite song on Kirks album! Kirk showed her the demo for this song when they reunited after a month apart that he had written about their lives and she found herself crying in the back of an Uber in Kenya."},{song_title:"Where Your Treasure Is",artist:"Jon Guerra",url:"https://open.spotify.com/track/5GnpnwPvuHXz2fuoq9skgc?si=79968b1c4339440e",description:"Kirk loves Jon Guerras songwriting and thinks Jon made an often-repeated passage feel brand new and deeply personal."},{song_title:"Opalite",artist:"Taylor Swift",url:"https://open.spotify.com/track/3yWuTOYDztXjZxdE2cIRUa?si=f96812df8028448e",description:"This bop pushed Jessica through her last two weeks of boards studying. She's had a Taylor Swift dance party for every standardized test she's taken!"}]},{section:"interests",content:[{interest:"Various housekeeping/DIY projects",description:"Kirk has learned things he never thought he'd need to learn, like how to repair a toilet paper holder, change a showerhead, and do various lawncare tasks. It's a privilege to do these things though, so he is generally thankful. But it also takes a lot of energy to follow through with grand plans."},{interest:"Focaccia",description:"Jessica started making focaccia at home after being influenced by Instagram. So far, she's made Chinese sausage-scallion, brown butter apple fritter, and pizza focaccia."}]}],$w=[{section:"special-values",special_values_name:"perry-elise"},{section:"intro",content:[{type:"photo",src:"/2025/perry-elise/introPe.jpg"},{type:"text",person:"Elise",text:"Elise has been able to make more time this year for the people and the issues she loves. She was able to take two trips to San Diego, once in January with Monica, just to spend time with her parents, who are both in their nineties, and the other time in August, to escort her parents home after the big 90th birthday celebration (see Travel section below). She was also able to spend significant time with Arie during the transition when Laura started working again, but Arnolds mom was still not free to be the regular caregiver. Elise has also returned to the state board of the NJ PTA. She chaired the Health and Safety Committee this year, and will return to chairing the Legislative Affairs Committee next year. In addition, Elise has become a poll worker, assisting in making sure our elections run smoothly. At church, she is discipling several women, and has recently rejoined the ESMT, the committee that oversees the ministries of the English congregation. She is also still walking regularly, and core training online with her sister Frannie, who is a licensed professional trainer. God has been teaching her to stop praying primarily for her familys safety and success, and to pray instead for their hearts to hunger and thirst for God."},{type:"text",person:"Perry",text:"Perry is 66 this year and thinks quite often about retirement, even more often whenever he sees Arie, our granddaughter. But he has to wait until Elise is eligible for Medicare, so until then, he will, God willing, work.  Perry is still a contractor for Lockheed Martin working on requirements, models and system design. Still busy at church doing Audio / Visual, lay preaching and teaching Sunday school classes.  Thinking seriously about how he would serve after he retired. In terms of his health, he has made some changes to his diet to address his pre-diabetes. Fortunately,  Elise has been accommodating and spends significant time making healthy salads and roasted veggies. Perry has also experienced hip pain, made worse by a fall in his front walkway this autumn. With much thanks to God, he has healed significantly and has returned to light running in the morning. Grateful to God for having all of the progeny within an hour and a half of our house. Our hearts are full. Perrys reading through epistles of the New Testament has really challenged him in how God sees people and how hard his heart is in light of Gods mercy.  Pray for him as he experiences Gods leading."}]},{section:"travel",content:[{location:"Fairfax, VA",latLong:[38.85516056442889,-77.30149214058392],img:"fairfax",description:"For Arie's dedication at All Peoples Community Church."},{location:"Houston, TX",latLong:[29.762703028646502,-95.36026222135195],img:"houston",description:"For one last visit with Jessica and Kirk before they move when Jessica completes her residency.  Highlights were BBQ (obviously), Crawfish and Noodles, a tour of Daikin Park, a day at Herman Park anid Agnes and Sherman (an Asian diner)."},{location:"Berkshires",latLong:[42.30705008626082,-73.24900250899663],img:"berkshires",description:"To jointly celebrate Elises moms and Elises Auntie Sue's 90th birthdays.  It was a reunion of 70 and more people coming from all over the US, Europe and Africa."},{location:"Washington, DC",latLong:[38.89872772911046,-77.04480209631903],img:"dc",description:"Church Bible Study group outing to the Museum of the Bible and dinner at the Wharf.  On the return trip, we had steamed Maryland crabs."},{location:"California",latLong:[37.86403677125613,-119.52777220979456],img:"california",description:"Visited Yosemite National Park and stayed with Elises sister and brother-in-law at their homes in Lake Tahoe and Sacramento."}]},{section:"best-bites",content:[{location_name:"Agnes and Sherman",dish_name:"Crawfish Egg Foo Young",img:"crawfish",description:"A classic Chinese American takeout dish with its narrative reclaimed. Delicious!"},{location_name:"An house",dish_name:"Roasted Salmon with Roasted Corn Salad",img:"salmon",description:"NYTimes one sheet pan recipe that was exceptional."},{location_name:"Mawn",dish_name:"Ginger and Melon Salad",img:"mawn",description:"So complex but yummy."},{location_name:"886",dish_name:"Dry Fried Beef Noodles",img:"noodles",description:"You should see Monicas noodle pull video."},{location_name:"Succotash",dish_name:"Delta Rice Bowl",img:"succotash",description:"Brunch in DC before hitting the museums."},{location_name:"Le Veau Dor",dish_name:"Duck Magret",img:"duck",description:"Old school dish at an old school NYC neighborhood bistro."},{location_name:"Mikan",dish_name:"Tamago Sando",img:"tamago",description:"Their Unagi Sando was a close second."}]},{section:"music",content:[{song_title:"Swing to Bop",artist:"Charlie Christian",url:"https://open.spotify.com/track/0qqacd9DgUtKduGw0znvqA?si=88fc5c2cb4d04957",description:"Discovered Swing to Bop, a bootleg recording of Charlie Christian in an impromptu jam session at Mintons Playhouse in 1941, unfettered from the formal styles of his employer, Benny Goodman."},{song_title:"The Ocean",artist:"Josh Redman",url:"https://open.spotify.com/track/1NGf8FvPcCau3GuEZcfluv?si=40e995b4a1ed4c23",description:"Josh Redmans cover of Zeppelins the Ocean. Such energy and joy."},{song_title:"Jealous Moon",artist:"Sarah Jarosz",url:"https://open.spotify.com/track/4cFeho8LgQdbrvp6caSloz?si=451c23f403a64636",description:"Sarah Jarosz is a fantastic singer-songwriter who plays great mandolin."},{song_title:"I Need You",artist:"Kirk An",url:"https://open.spotify.com/track/6ZXlPi6sNwzfocgmNEiZ0R?si=hZQm6QZdTZSUr6GAa7bh8Q",description:"The Gospel, the Good News of Jesus is very simple and fulfills our deepest longing.  This song encapsulates it beautifully."},{song_title:"Dance me to the End of Love",artist:"Madeleine Peyroux",url:"https://open.spotify.com/track/13zjNPZUyWvzZC2dlYjW0L?si=0c627c775511406d"},{song_title:"Afro Blue",artist:"Erykah Badu",url:"https://open.spotify.com/track/7e0j6jReCfN5KJkDNLHyHQ?si=4af4743185914fa9"},{song_title:"Hypotheticals",artist:"Lake Street Dive",url:"https://open.spotify.com/track/5lE2EFXt4muvLFMGQg4hZN?si=0c52c91a329346fc",description:"That drumming!"},{song_title:"Midnight in Harlem",artist:"Tedeschi Trucks Band",url:"https://open.spotify.com/track/1ncSAZD0bzvU3cu0uPLbWd?si=d95552eca35045ad",description:"The singer tells the narrative but the guitar solo reveals the heart."}]},{section:"interests",content:[{interest:"National parks",description:"Perry got a senior life time National Park pass. Elise got a National Park passport just waiting for National Park stamps.  We are seniors waiting to be amazed by Gods creation!"}]}],Kw=[{section:"special-values",special_values_name:"arnold-laura-arie"},{section:"intro",content:[{type:"text",person:"Laura",text:"Lauras been settling into her role as a mom this year and adjusting to life in a new environment since our move to New Jersey. She got to spend an unexpectedly long time on maternity leave for the first half of the year - which ended up being a very sweet time spent with Arie, and a chance to help her ease into the move to NJ. Laura was able to transfer to the NYC office and thankfully continue working the same job but part time, which felt both familiar (the type of work is the same) and new (meeting new coworkers, holding stricter work/life balance boundaries to make it home to see Arie before bedtime). In her free time, Lauras enjoyed the space planning and decorating aspects of moving into a new house, gotten back into reading for fun again, and is slowly venturing back into the world of photography."}]},{section:"travel",content:[{location:"Pine Brook, NJ",latLong:[40.875425907781654,-74.34970383704335],img:"pinebrook",description:"We moved (!!) in May to Pine Brook, NJ, to be closer to family."},{location:"Berkshires",latLong:[42.30705008626082,-73.24900250899663],img:"berkshiresALA",description:"Went to the Berkshires in August for our Hsieh/Lee reunion! Got to see all the cousins and Arie met her great grandparents for the first time!"},{location:"Ann Arbor, MI",latLong:[42.279539694180286,-83.74129087165247],img:"annarbor",description:"Went to Ann Arbor in November to visit Arnolds friend Ben and his family. Arie got to play with Bens two kids and she went on her first plane ride (and did pretty good!)"}]},{section:"best-bites",content:[{location_name:"Raku",dish_name:"Nabeyaki udon",img:"udon",description:"Chicken, shrimp tempura, sea eel, fish cake, shiitake mushroom, sansai, egg. Truly the most delightful bowl of udon Ive ever tried - an incredibly rich and complex broth, juicy chicken, and light tempura. I think about this often."},{location_name:"Laboratorio Kitchen",dish_name:"Meatball",img:"meatball",description:"The most gigantic meatball youll ever eat, and the tastiest."},{location_name:"Faubourg",dish_name:"Grilled octopus & lentil appetizer",img:"octopus"},{location_name:"Kaijiken",dish_name:"Abura soba",img:"kaijiken",description:"Perfect noodle texture and really tasty savory meat sauce."}]}],Gw=[{section:"special-values",special_values_name:"monica"},{section:"intro",content:[{type:"photo",src:"/2025/monica/introm.jpg",vertical:!0},{type:"text",person:"Monica",text:"Monica had an exciting and diverse year, dipping her toes into some new ventures at the beginning and settling down a bit by the end of it. She started the year running around as a production assistant on a few music videos, and began following in her sisters footsteps into photography. She began working at a preschool for the 2025-2026 school year and has been spending her days with 3 year olds since. In her free time, she is still dancing, of course, doing small projects with her friends and taking classes for fun. One of her favorite things to do is to meet up with her college friends to journal or read together at cafes."}]},{section:"travel",content:[{location:"San Diego",latLong:[40.875425907781654,-74.34970383704335],img:"ahmah",description:"In January I went to San Diego with mom, got to spend time with Ah Mah and Ah Kgong and see a few cousins and friends "},{location:"London",latLong:[51.516990425381685,-.12014440712924411],img:"london",description:"In April I went to London to visit my college roommate! I got to be a tourist on my first trip to Europe, and spend time with some of my favorite people."},{location:"New York City",latLong:[40.727731730968074,-74.00011324861664],img:"nyc",description:"From June to August in New York City, I decided to sublet for the summer to train in dance. It was a really enlightening and exciting experience, and I made a lot of new friends and gained a lot of knowledge :)"},{location:"Berkshires",latLong:[42.30705008626082,-73.24900250899663],img:"berkshiresM",description:"In August I went to the Berkshires for the reunion. Was really fun to get to see all of the cousins from both near and far!"}]},{section:"best-bites",content:[{location_name:"Momo Crave",dish_name:"Tandoori Momo",img:"momo",description:"My go-to quick bite while subletting in Queens. Super flavorful, a little kick of spice, and a generous portion."},{location_name:"Cafe W",dish_name:"Pollock roe salt bread, mojito-ade",img:"cafew",description:"They only have the pollock roe bread in the morning and yes I was waking up early just to snag it. Hands down my favorite cafe in Flushing."},{location_name:"Daesung Noodles",dish_name:"Fish cake soup",img:"daesung",description:"A little pricey but so warming and delicious. Perfect for a winter day."},{location_name:"BunsikNara",dish_name:"Combo C (cream pasta, fried rice, and Korean fried chicken)",img:"comboc",description:"Not new for me but still a fave! Ive been getting this combo to split with 2-3 friends since college. Still hits."},{location_name:"969 NYC Coffee",dish_name:"Literally any of their onigirazu",img:"onigirazu",description:"I think I ascended when I took that first bite. Note: you must call ahead; the owner makes everything to order and is very friendly!"}]},{section:"music",content:[{song_title:"Love Attack",artist:"Ferrara",url:"https://open.spotify.com/track/6InkUn4bo6xzoaMbgJa5UN?si=a150ba16d8114654",description:"One of my favorite disco songs to dance to this summer. Its fun!"},{song_title:"What Time Is It",artist:"Crystal Kay",url:"https://open.spotify.com/track/64lyXLGhKgKrAKqcQ2hINc?si=40de37ac8ca147a8",description:"Went back to one of my middle school faves with this one. Its just good vibes."},{song_title:"Close 2 U",artist:"Raveena",url:"https://open.spotify.com/track/7rgvhF2a3WjRkRtx2lndyc?si=d498f2a398a44c16",description:"I went to her concert this year and was enchanted by her performance this is one of my favorites by her "},{song_title:"Bittersweet Goodbyes",artist:"Joyce Wrice",url:"https://open.spotify.com/track/1otiDJ357ZDfyaJpK4IvNQ?si=c5b46a285ded46ce",description:"Made choreography to this song this year and can somehow still listen to it!"},{song_title:"",artist:"Karencici",url:"https://open.spotify.com/track/5CCV2xxYnI7b1wFkP1gElh?si=46a2d6af3035438c",description:"We love a Chinese R&B pop hit."},{song_title:"Resume",artist:"Jenevieve",url:"https://open.spotify.com/track/7e0j6jReCfN5KJkDNLHyHQ?si=4af4743185914fa9",description:"This song soothed me this year!"},{song_title:"Mwah!",artist:"Lojay, Odeal",url:"https://open.spotify.com/track/3kea45Zl41BwV83RxCxBbw?si=a3d7c38a57f147a1",description:"My favorite dance class of the year was to this song!!"},{song_title:"Cant Get You",artist:"Jaehyun",url:"https://open.spotify.com/track/5rQK8kcBmwVGuJqqzMJApQ?si=fefa5b9e673a4562",description:"My favorite song to drive to hehe"}]},{section:"interests",content:[{interest:"Waacking",description:"The biggest reason I went to NYC this summer was to learn a specific dance style called waacking, which is a disco era style that is difficult to find a foundational class for if not in the city. I was able to really get plugged into the community and learn from some really talented people! It also really nurtured my appreciation for disco music."}]}],Jw=ce.div`
